                         :class="lastLevel >= getLevelByLevelAndLocation(level) ? 'level-done' : ''">
                        <div v-show="lastLevel >= getLevelByLevelAndLocation(level) - 1">
                            {{getLevelByLevelAndLocation(level)}}
                        </div>
                        <div class="close-level" v-if="lastLevel < getLevelByLevelAndLocation(level)-1"></div>
                    </div>
                    <div class="prev-location" @click="prevLocation()" v-if="location > 0"></div>
                    <div class="next-location" @click="nextLocation()" v-if="location < allLocations-1"></div>


                </div>
                <div class="close-location" v-show="location !== 0 && lastLevel < location * 20">
