    function shuffle(arr) {
        let j, temp;
        let tempArr = arr.slice();
        for (let i = arr.length - 1; i > 0; i--) {
            j = Math.floor(Math.random() * (i + 1));
            temp = arr[j];
            arr[j] = arr[i];
            arr[i] = temp;
        }
        for (let i = arr.length - 1; i > 0; i--) {
            if (tempArr[i] !== arr[i]) return arr;
        }
        return shuffle(arr);
    }

