    function down(ev, blockX, blockY) {
        if (blockX && false) {
            nowLine.x = blockX;
            nowLine.y = blockY;
        } else {
            nowLine.x = ev.clientX || ev.changedTouches[0].clientX;
            nowLine.y = ev.clientY || ev.changedTouches[0].clientY;
        }
        document.onmousemove = elementDrag;
        document.ontouchmove = elementDrag;
        document.onmouseup = closeDragElement;
        document.ontouchend = closeDragElement;
        document.querySelectorAll('.action-block__letter').forEach((e) => {
            e.ontouchmove = elementDrag;
            e.ontouchend = closeDragElement;
        })
