    function elementDrag(e) {
        let add =  window.pageYOffset*2;
        cx.clearRect(0, 0, canvas.width, canvas.height);
        let x = e.clientX || e.changedTouches[0].clientX;
        let y = e.clientY || e.changedTouches[0].clientY;

        cx.beginPath();
        cx.strokeStyle = '#2b75a4';
        cx.lineWidth = 12;


        rememberedLines.forEach((obj) => {
            cx.moveTo(obj.fromX * 2, obj.fromY * 2);
            cx.lineTo(obj.toX * 2, obj.toY * 2);
            cx.stroke();
        });

        cx.moveTo(nowLine.x * 2, nowLine.y * 2 + add);
        cx.lineTo(x * 2, y * 2 + add);
        cx.stroke();
        cx.closePath();
        let elBellow = document.elementFromPoint(x, y);
        if (elBellow && elBellow.classList.contains('action-block__letter')
            && !elBellow.classList.contains('action-block__letter_selected')) {

            elBellow.dispatchEvent(new CustomEvent("selectLetter"));


            let bounding = elBellow.getBoundingClientRect();
            let left = bounding.left + (bounding.width / 2);
            let top = bounding.top + (bounding.height / 2);

            rememberedLines.push({fromX: nowLine.x, fromY: nowLine.y + add/2, toX: left, toY: top + add / 2});
            nowLine.x = left;
            nowLine.y = top;

        }

    }

    function closeDragElement() {
        rememberedLines = [];
        document.querySelector('.action-block').dispatchEvent(new CustomEvent("stopLetters"));
        cx.clearRect(0, 0, canvas.width, canvas.height);
        document.onmouseup = null;
        document.ontouchend = null;
