    function testLineEmpty(line) {
        for (let q = 0; q < line.length; q++) {
            if (line[q] !== '') {
                return false;
            }
        }
        return true;
    }

    function testColumnEmpty(table, column) {
        for (let q = 0; q < table.length; q++) {
            if (table[q][column] !== '') {
                return false;
            }
        }
        return true;
    }

    function centerCrossword(lastTable) {
        //Сдвинуть верхние или нижние границы
        let table = [];
        for (let i = 0; i < lastTable.length; i++) {
            table.push(lastTable[i].slice());
        }
        while (testLineEmpty(table[0])) {
            table.splice(0, 1);
        }
        while (testLineEmpty(table[table.length - 1])) {
            table.splice(table.length - 1, 1);
        }
        while (testColumnEmpty(table, 0)) {
            for (let i = 0; i < table.length; i++) {
                table[i].splice(0, 1);
            }
        }
        while (testColumnEmpty(table, table[0].length - 1)) {
            for (let i = 0; i < table.length; i++) {
                table[i].splice(table[i].length - 1, 1);
            }
        }
        return table;
    }

    function makePair(i, q) {
        return i + '-' + q;
    }

    function findAllWordsInCrossword(table) {
        let words = {};
        for (let row = 0; row < table.length; row++) {
            for (let col = 0; col < table[row].length; col++) {
                if (table[row][col] !== '') {
                    let i = row;
                    let q = col;
                    let word = table[i][q];
                    let wordPairs = [];
                    wordPairs.push(makePair(i, q));
                    let qWas = q;

                    //Строка
                    if (q === 0 || table[i][q - 1] === '') {
                        while (q + 1 < table[i].length && table[i][q + 1] !== '') {
                            q++;
                            wordPairs.push(makePair(i, q));
                            word += table[i][q];
                        }
                        if (word.length > 1) words[word] = wordPairs;
                    }
                    //Столбец
                    q = qWas;
                    word = table[i][q];
                    wordPairs = [];
                    wordPairs.push(makePair(i, q));
                    if (i === 0 || table[i - 1][q] === '') {
                        while (i + 1 < table.length && table[i + 1][q] !== '') {
                            i++;
                            wordPairs.push(makePair(i, q));
                            word += table[i][q];
                        }
                        if (word.length > 1) words[word] = wordPairs;
                    }

                }
            }
        }
        return words;
    }

