                    }
                    this.notCrosswordWords = notCrosswordWords[this.word];
                } catch (e) {
                    this.notCrosswordLength = 0;
                    this.notCrosswordWords = [];
                }

                this.nowWords = centerCrossword(wordsFromWords[lvl][1]);
                this.testWords = findAllWordsInCrossword(this.nowWords);
                if (this.lvl === this.lastLevel) {
                    this.doneCells = allDoneWords;
                } else {
                    this.doneCells = [];
                }
                this.fieldClass = '';
                for (let i = 6; i >= 3; i--) {
                    if (
                        (this.nowWords.length === i && this.nowWords[0].length <= i)
                        ||
                        (this.nowWords[0].length === i && this.nowWords.length <= i)
                    ) {
                        this.fieldClass = 'words__letters_' + i;
                        break;
                    }
                }

                this.allCells = [];
                let keys = Object.keys(this.testWords);
                for (let i = 0; i < keys.length; i++) {
                    let arr = this.testWords[keys[i]];
                    for (let q = 0; q < arr.length; q++) {
                        if (!this.allCells.includes(arr[q])) {
                            this.allCells.push(arr[q]);
                        }
                    }

                }
                this.testWin();

                if (showAdv && advTime) {
                    setTimeout(() => {
                        showAdv();
                        this.advShowNow = true;
                        setTimeout(() => {
                            this.advShowNow = false;
                        }, 10000)
                    }, 300)
                }
                this.getCanvas()
            },
            getLevelEnd() {
                this.levelEnd = true;
            },
            getNextLevel() {
                this.getLevel(this.lvl + 1);
            },
            toggleShowDoneWordsTip() {
                this.showDoneWordsTip = !this.showDoneWordsTip;
            },
            getCanvas() {
                getLinePaint();
            },
            getLevelByLevelAndLocation(level) {
                return (this.location * 20) + level;
            },
            toggleRules() {
                this.rules = !this.rules;
            },
            advTip() {
                if (this.tipCount > 0) return false;
                return !!(showAdv && advTime);
            },
            switchSounds() {
                this.isSounds = !this.isSounds;
                localStorage.setItem('isSounds', this.isSounds);
            },
            nextLevel() {
                if (this.lvl === wordsFromWords.length - 1
                    ||
                    this.lastLevel <= this.lvl) return;
                this.getLevel(this.lvl + 1);
            },
            prevLocation() {
                if (this.location > 0) {
                    this.location--;
                    if (this.isSounds) {
                        clickSound.play();
                    }
                }
            },
            nextLocation() {
                if (this.location < this.allLocations - 1) {
                    this.location++;
                    if (this.isSounds) {
                        clickSound.play();
                    }
                }
            },
            selectLetter(index) {
                this.wordFromLetter += this.letters[index];
                this.selectedLetters.push(index);
                if (this.isSounds) {
                    selectLetter.play();
                }
            },
            selectFirstLetter(e, index) {
                if (this.mergeAnim || this.animLetters.length > 0 || this.isBadWord) return;
                rememberedLines = [];
                this.wordFromLetter = this.letters[index];
                this.selectedLetters = [index];
                let elBellow = document.elementFromPoint(
                    e.clientX || e.changedTouches[0].clientX,
                    e.clientY || e.changedTouches[0].clientY);
                if (elBellow) {
                    let bounding = elBellow.getBoundingClientRect();
                    down(e, bounding.left + (bounding.width / 2), bounding.top + (bounding.height / 2));
                } else {
                    down(e);
                }
                if (this.isSounds) {
                    selectLetter.play();
                }
            },
            backMenu() {
                if (this.isSounds) {
                    clickSound.play();
                }

                this.levels = true;
                this.levelsAnim = true;
                setTimeout(() => {
                    this.content = false;
                }, 500);

            },
            getTip() {
                if (this.animLetters.length !== 0 || this.allCells.length === this.doneCells.length) return;
                if (this.tipCount < 1) {
                    if (showAdv && advTime) {
                        showAdv();
                        this.tipCount++;
                        STATESTATS.wordsTips = this.tipCount;
                        setStats();
                    }
                    return;
                }
                this.tipCount--;
                if (this.isSounds) {
                    doneWordSound.play();
                }
                localStorage.setItem('wordsTips', this.tipCount);
                STATESTATS.wordsTips = this.tipCount;
                setStats();
                let arr = this.allCells.slice();
                for (let i = 0; i < this.doneCells.length; i++) {
                    let index = arr.indexOf(this.doneCells[i]);
                    if (index !== -1) arr.splice(index, 1);
                }
                let rand = Math.floor(Math.random() * arr.length);
                this.animLetters = [arr[rand]];
                let newCells = this.doneCells.slice();
                newCells.push(arr[rand]);
                if (this.lvl === this.lastLevel) {
                    localStorage.setItem('wordsAllDoneWords', JSON.stringify(newCells));
                    STATE.wordsAllDoneWords = newCells;
                    setState();
                }
                setTimeout(() => {
                    this.animLetters = [];
                    this.doneCells.push(arr[rand]);
                    if (this.testWin()) {
                        this.getNewLevel();
                    }
                }, 1000)
            },
            sendWord() {
                if (this.animLetters.length !== 0
                    || this.wordFromLetter.length === 0
                    || this.mergeAnim) return;
                let key = false;
                let yesWords = false;
                if (this.testWords[this.wordFromLetter]) {
                    yesWords = true;
                    let cells = this.testWords[this.wordFromLetter];
                    for (let i = 0; i < cells.length; i++) {
                        if (!this.doneCells.includes(cells[i])) {
                            key = true;
                            break;
                        }
                    }
                }
                if (key) {
                    let wordFromLetter = this.wordFromLetter;
                    this.wordFromLetter = '';
                    this.selectedLetters = [];
                    setTimeout(() => {
                        if (this.isSounds) {
                            doneWordSound.play();
                        }
                        this.animLetters = this.testWords[wordFromLetter];
                        let newCells = this.doneCells.slice();
                        for (let i = 0; i < this.testWords[wordFromLetter].length; i++) {
                            if (!newCells.includes(this.testWords[wordFromLetter][i])) {
                                newCells.push(this.testWords[wordFromLetter][i]);
                            }
                        }
                        allDoneWords = newCells;
                        if (this.lvl === this.lastLevel) {
                            localStorage.setItem('wordsAllDoneWords', JSON.stringify(newCells));
                            STATE.wordsAllDoneWords = newCells;
                            setState();
                        }
                        setTimeout(() => {
                            this.doneCells = newCells;


                            this.animLetters = [];
                            if (!this.testWin()) {
                                if (showAdv && advTime) {
                                    setTimeout(() => {
                                        showAdv();
                                        this.advShowNow = true;
                                        setTimeout(() => {
                                            this.advShowNow = false;
                                        }, 10000)
                                    }, 300)
                                }
                            } else {
                                this.getNewLevel();

                            }


                        }, 1000)
                    }, 100);

                } else if (allNotCrosswordWords[this.word] && allNotCrosswordWords[this.word].includes(this.wordFromLetter) && !this.notCrosswordWords.includes(this.wordFromLetter)) {
                    this.notCrosswordWords.push(this.wordFromLetter);
                    this.wordFromLetter = '';
                    this.selectedLetters = [];
                    localStorage.setItem('notCrosswordWords', JSON.stringify(notCrosswordWords));
                    STATE.notCrosswordWords =  notCrosswordWords;
                    setState();
                    numOfNotWords++;
                    this.doneWordsAnim = true;
                    if (this.isSounds) {
                        setTimeout(() => {
                            notWordsSound.play();
                        }, 200);
                    }
                    setTimeout(() => {
                        this.doneWordsAnim = false;
                    }, 400);
                    if (numOfNotWords >= 5) {
                        this.tipCount++;
                        numOfNotWords = 0;
                        localStorage.setItem('wordsTips', this.tipCount);
                        STATESTATS.wordsTips = this.tipCount;
                        setStats();
                    }
                    localStorage.setItem('numOfNotWords', numOfNotWords);
                    STATE.numOfNotWords = numOfNotWords;
                    setState();


                } else if (yesWords) {
                    this.animDoneLetters = this.testWords[this.wordFromLetter];
                    if (this.isSounds) {
                        wrongWordSound.play();
                    }
                    this.selectedLetters = [];
                    this.wordFromLetter = '';
                    setTimeout(() => {
                        this.animDoneLetters = [];
                    }, 500)
                } else {

                    this.isBadWord = true;
                    this.selectedLetters = [];
                    if (this.isSounds) {
                        wrongWordSound.play();
                    }
                    setTimeout(() => {
                        this.isBadWord = false;
                        this.wordFromLetter = '';
                    }, 200)
                }
            },
            getNewLevel() {
                setTimeout(() => {
                    this.getLevelEnd();
                    if (this.isSounds) {
                        newLevelSound.play();
                    }
                }, 200)
            },
            testWin() {
                if (this.doneCells.length >= this.allCells.length) {
                    if (this.lvl === this.lastLevel) {
                        allDoneWords = [];
                        this.lastLevel++;
                        localStorage.setItem('lastLevel', this.lastLevel);
                        localStorage.setItem('wordsAllDoneWords', '[]');
                        STATESTATS.lastLevel = this.lastLevel;
                        setStats();
                        STATE.wordsAllDoneWords = [];
                        setState();
                    }
                    return true;
                }
                return false;
            },
            mergeLetters() {
                if (this.mergeAnim || this.animLetters.length !== 0) return;
                this.mergeAnim = true;
                document.querySelector('.action-block__letters')
                    .classList.add('merge-letters');
                try {
                    this.letters = shuffle(this.letters);
                } catch (ignored) {
                }

                setTimeout(() => {
                    let letters = document.querySelectorAll('.action-block__letter');
                    for (let i = 0; i < this.letters.length; i++) {
                        letters[i].innerText = this.letters[i];
                    }
                    document.querySelector('.action-block__letters')
                        .classList.remove('merge-letters');
                }, 350);
                setTimeout(() => {
                    this.refresh++;
                    this.mergeAnim = false;
                }, 620);
                if (this.isSounds) {
                    mergeSound.play();
                }

            }
        },
        mounted: function () {
            this.$nextTick(function () {
                if (doDeleteBlock) {
                    if (document.querySelector(".pre-download")) {
                        document.querySelector(".pre-download").remove()
                    }
                    if (lastLevel !== 0) {
                        this.getLevel(lastLevel);
                    }
                }
                getLinePaint();

            })
        }
    }

</script>


